import ImgLink from "../shared/ImgLink"

const PopProducers = (props) => {
    const { elements } = props

    return (
        <section class="pop-producers">
            <div class="section-header clearfix">
                <span class="section-title">Популярные производители:</span>
                <a class="btn" href="oi">Все производители</a>
            </div>
            <figure class="companies-logo">
                {elements.map((elements, i) => <ImgLink href={elements.href} src={elements.src} width={elements.width} height={elements.height} alt={elements.alt}></ImgLink>)}
            </figure>
        </section>
    )
}

export default PopProducers
